	/**
  * Helper function to split the log array into smaller arrays
  * Calling json.stringify can cause issues on large objects
  * @param {} array
  * @param {int} size
  */
	chunk(array, size) {
		const chunked_arr = [];
		let index = 0;
		while (index < array.length) {
			chunked_arr.push(array.slice(index, size + index));
			index += size;
		}
		return chunked_arr;
	}

